import React from "react";
import './Apresentacao.css';
import logomarca from './imgs/logo_site.png';

const Apresentacao = () => {
  return (
    <div className="Apresentacao-container">
      <div id="apresentaca-text">       
        <h3 className="title">DATAVERSE</h3>
        <p class="texto">Nosso projeto tem como objetivo uma iniciativa de criação de site interativo e informativo<br/> sobre as estruturas de dados existentes em decorrência das aulas de estruturas de dados</p>
        <button className="saiba-mais">saiba mais</button>
      </div>
      <div>
        <div id="image-apresentacao">
        <img src={logomarca} />
      </div>
      </div>
      
    </div>
  );
};

export default Apresentacao;
